import React from "react";

const Testimonials = () => {
  return (
    <div>
      <div>
        <h2>Testimonials</h2>
      </div>
      <div class="testimonial-cards">
        <div name="testimonial-1"></div>
        <div name="testimonial-2"></div>
        <div name="testimonial-3"></div>
      </div>
    </div>
  );
};

export default Testimonials;
